(22, 16, 'patch baru:\r\nSEMUA YANG ADA TAB VIEW\r\nHighlight ketika salah satu list diklik (muncul detail kanan)\r\n\r\nPROYEK - VIEW PROYEK LIST\r\n1. Dipisah 2 tab, Aktif (Aktif/Purna/Selesai) dan Non-Aktif\r\n2. Tambah data Nomor Proyek (No. di data tabel), hanya untuk yang Proyek Aktif\r\ngenerate Nomor Proyek (No.) ketika proyek tersebut aktif / SJ pertama\r\n3. Detail sebelah kanan diganti hanya gambar proyek + 4 tombol terkait\r\n4. Tambah kolom: Tanggal Proyek Aktif, Tanggal Proyek Purna, Tanggal Proyek Selesai, Durasi Proyek (hari)\r\n\r\nPROYEK - VIEW DETAIL PROYEK\r\n1. Detail:\r\n-- Namaproyek + kota besar di atas\r\n-- Status Proyek di bawah \"DETAIL PROYEK\", sesuai warna yang di Data Proyek (ada background, font hitam)\r\n-- direngketin spasi antar baris tulisan semuanya\r\n-- sub judul dibesarkan fontnya\r\n2. Stock Lapangan:\r\n-- TOTAL STOK dipindah atas / sejajarkan dengan tabel, \r\nKolom non barang: \"TOTAL STOK LAPANGAN\" , angka barang ikut nama kolom bawah \r\n-- fontnya dibesarkan\r\n-- ada tombol \"plus\" per row, untuk expand informasi \r\nSJ awal + BAP pengurangnya (penyesuaian), \r\n3. Pengiriman + Pengembalian dijadikan satu: History Mutasi Barang\r\n-- Ada TOTAL STOK di atasnya (seperti Stok lapangan)\r\n4. Penyesuaian dihapus (dijadikan satu sama nomor 2)\r\n\r\nMUTASI BARANG - STOK LAPANGAN\r\n1. Bug, nomornya 16 semua -- disamakan / disesuaikan Nomor Proyek \r\n2. Proyek Non Aktif dihilangkan (Hanya yang aktif/purna/selesai)\r\n3. Tombol untuk HIDE/SHOW Proyek Selesai\r\n4. Bug, status purna harusnya background kuning\r\n5. Di paling atas, TOTAL STOCK LAPANGAN (posisi angka menyesuaikan nama kolom bawahnya)\r\n\r\nKEUANGAN - PENERIMAAN\r\nPembayaran \r\n1. Total Pembayaran NAMABULAN TAHUN (default bulan ini), ada tombol ganti bulan + semua bulan/1tahun\r\nTAHUN 2020\r\nAlokasi\r\n1. Total Pembayaran NAMABULAN TAHUN (default bulan ini), ada tombol ganti bulan + semua bulan/1tahun\r\nTAHUN 2020', 2, 11, 3, NULL, '2020-05-29 00:26:30', '2020-06-01 07:10:57', NULL),
